<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>La gestion des données est l'une des considérations les plus importantes à garder à l'esprit lors de la conception de toute application. Le but de toute application est d'obtenir des données en entrée, de les traiter ou de les exploiter, puis de fournir des données appropriées en sortie. Par exemple, si nous considérons un système de gestion hospitalière, nous pourrions avoir, entre autres, des données sur différents médecins, patients et documents d'archives. Le système de gestion hospitalière doit permettre d'effectuer diverses opérations, comme l'admission des patients, et de mettre à jour l'entrée et la sortie des médecins de différentes spécialités. Alors que l'interface utilisateur présenterait les informations dans un format pertinent pour les administrateurs de l'hôpital. En interne, le système gérerait différents enregistrements et listes d'éléments. Un programmeur dispose de plusieurs structures pour conserver toutes les données en mémoire. Le choix de la bonne structure pour contenir les données, également appelée <b>structure de données</b>, est crucial pour garantir la fiabilité, les performances et autoriser les fonctionnalités requises dans l'application. Outre les bonnes structures de données, le bon choix des algorithmes pour accéder et manipuler les données est également nécessaire au comportement optimal de l'application. Ce tutoriel vous donnera la capacité de mettre en oeuvre les structures de données et les algorithmes appropriés pour la conception de votre application, afin de vous permettre de développer des applications bien optimisées et évolutives.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="operations-sur-les-structures-de-donnees">Opérations sur les structures de données</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-structures-de-donnees_introduction">Introduction</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-structures-de-donnees_comparaison-des-avantages">Comparaison des avantages</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-structures-de-donnees_comparaison-des-performances">Comparaison des performances</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-structures-de-donnees_introduction" href="#operations-sur-les-structures-de-donnees">Introduction</a>
</h2><br>Avant de traiter les données dans une application, nous devons décider comment nous souhaitons stocker les données. La réponse à cette question dépend du type d'opérations que nous souhaitons effectuer sur les données et de la fréquence des opérations.<br><br>Nous devons choisir l'implémentation qui nous offre les meilleures performances en termes de latence, de mémoire ou de tout autre paramètre, sans affecter l'exactitude de l'application.
Une métrique utile pour déterminer le type de structure de données à utiliser est la complexité algorithmique, également appelée complexité temporelle.<br><br>La complexité temporelle indique le temps relatif requis, proportionnellement à la taille des données, pour effectuer une certaine opération.
Ainsi, la complexité temporelle montre comment le temps variera si nous modifions la taille de l'ensemble de données.
La complexité temporelle des différentes opérations sur n'importe quel type de données dépend de la manière dont les données y sont stockées.<br><br>Les structures de données peuvent être divisées en deux types:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Les structures de données contiguës.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Les structures de données liées.</div>
</div><br>Pour toute application, nous pouvons choisir soit une structure de données, soit une combinaison des deux, en fonction des exigences et des fréquences des différentes opérations.
Les tableaux et les listes chaînées sont très courants et sont largement utilisés dans toute application pour stocker des données. Par conséquent, la mise en oeuvre de ces structures de données doit être aussi exempte de bogues et efficace que possible. Pour éviter de réinventer le code, C++ fournit diverses structures, telles que std::array, std::vector et std::list. Nous en verrons certains plus en détail
dans les prochaines sections.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-structures-de-donnees_comparaison-des-avantages" href="#operations-sur-les-structures-de-donnees">Comparaison des avantages</a>
</h2><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-structures-de-donnees_comparaison-des-performances" href="#operations-sur-les-structures-de-donnees">Comparaison des performances</a>
</h2><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="operations-sur-les-structures-de-donnees-contigues">Opérations sur les structures de données contigües</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-structures-de-donnees-contigues_introduction">Introduction</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-structures-de-donnees-contigues_introduction" href="#operations-sur-les-structures-de-donnees-contigues">Introduction</a>
</h2><br>Les structures de données contiguës stockent tous les éléments dans un seul bloc de mémoire. Le diagramme suivant montre comment les données sont stockées dans des structures de données contiguës:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Dans le diagramme précédent, considérez le plus grand rectangle comme le bloc de mémoire unique dans lequel tous les éléments sont stockés, tandis que les plus petits rectangles représentent la mémoire allouée à chaque élément. Une chose importante à noter ici est que tous les éléments sont du même type. Par conséquent, tous nécessitent la même quantité de mémoire, indiquée par sizeof(type).<br><br>L'adresse du premier élément est également connue sous le nom d'adresse de base (BA). Puisqu'ils sont tous du même type, l'élément suivant est présent à l'emplacement BA + sizeof(type), et celui qui suit est présent dans BA + 2 * sizeof(type), et ainsi de suite. Par conséquent, pour accéder à n'importe quel élément à l'index i, nous pouvons l'obtenir avec la formule générique : BA + i * sizeof(type).<br><br>Puisque tous les éléments sont présents les uns à côté des autres, lors de l'accès à l'un des éléments, quelques éléments à côté de lui sont également introduits dans le cache. Ainsi, si vous souhaitez accéder à ces éléments, c'est une opération très rapide puisque les données sont déjà présentes dans le cache. Cette propriété est également connue sous le nom de localité de cache (<b>cache locality</b>). Bien que cela n'affecte pas la complexité temporelle asymptotique des opérations, lors du parcours d'un tableau, cela peut donner un avantage impressionnant pour les données contiguës dans la pratique. Étant donné que le parcours nécessite de parcourir tous les éléments séquentiellement, après avoir récupéré le premier élément, les éléments suivants peuvent être récupérés directement à partir du cache. Par conséquent, on dit que le tableau a une bonne localité de cache.<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="operations-sur-les-structures-de-donnees-liees">Opérations sur les structures de données liées</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-structures-de-donnees-liees_introduction">Introduction</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-structures-de-donnees-liees_introduction" href="#operations-sur-les-structures-de-donnees-liees">Introduction</a>
</h2><br>Les structures de données liées contiennent les données dans plusieurs blocs de mémoire, également appelés noeuds, qui peuvent être placés à différents endroits de la mémoire. Le diagramme suivant montre comment les données sont stockées dans des structures de données liées:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Dans la structure de base d'une liste chaînée, chaque noeud contient les données à stocker dans ce noeud et un pointeur vers le noeud suivant. Le dernier noeud contient un pointeur NULL pour indiquer la fin de la liste.<br><br>Pour atteindre n'importe quel élément, nous devons commencer par le début de la liste chaînée, c'est-à-dire la tête, puis suivre le pointeur suivant jusqu'à atteindre l'élément souhaité. Ainsi, pour atteindre l'élément présent à l'index i, nous devons parcourir la liste chaînée et itérer i fois. Par conséquent, nous pouvons dire que la complexité d'accès aux éléments est O(n) ; c'est-à-dire que le temps varie proportionnellement au nombre de noeuds.<br><br>Si nous voulons insérer ou supprimer un élément, et si nous avons un pointeur vers cet élément, l'opération est vraiment petite et assez rapide pour une liste chaînée par rapport aux tableaux statiques. Voyons comment fonctionne l'insertion d'un élément dans une liste chaînée. Le diagramme suivant illustre un cas où nous insérons un élément entre deux éléments dans une liste chaînée:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Pour l'insertion, une fois que nous avons construit le nouveau noeud à insérer, il suffit de réorganiser les liens pour que le pointeur suivant de l'élément précédent (i = 1) pointe vers le nouvel élément (i = 2) au lieu de son élément actuel (i = 3), et le pointeur suivant du nouvel élément (i = 2) pointe vers l'élément suivant de l'élément actuel (i = 3). De cette façon, le nouveau noeud fait partie de la liste chaînée.<br><br>De même, si l'on souhaite supprimer un élément, il suffit de réorganiser les liens pour que l'élément à supprimer ne soit plus connecté à aucun des éléments de la liste. Ensuite, nous pouvons libérer cet élément ou prendre toute autre action appropriée.<br><br>Une liste chaînée ne peut pas du tout fournir de localité de cache puisque les éléments ne sont pas stockés de manière contiguë en mémoire. Par conséquent, il n'y a aucun moyen d'introduire l'élément suivant dans le cache sans le visiter avec le pointeur stocké dans l'élément actuel. Ainsi, même si, en théorie, il a la même complexité temporelle de parcours qu'un tableau statique, en pratique, il donne des performances médiocres.<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="operations-sur-les-tableaux">Opérations sur les tableaux</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux_introduction">Introduction</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux_introduction" href="#operations-sur-les-tableaux">Introduction</a>
</h2><br>Les deux principaux types de tableaux sont les tableaux statiques et les tableaux dynamiques. Un tableau statique a une durée de vie uniquement à l'intérieur de son bloc de déclaration, mais un tableau dynamique offre une meilleure flexibilité puisque le programmeur peut déterminer quand il doit être alloué et quand il doit être libéré. Nous pouvons choisir l'un ou l'autre en fonction des besoins. Les deux ont les mêmes performances pour des opérations différentes.<br><br>Depuis que ce tableau a été introduit en C, il est également connu sous le nom de tableau de style C. Voici comment ces tableaux sont déclarés:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un tableau statique est déclaré comme:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">int arr[size];</pre><br></div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un tableau dynamique en C est déclaré comme:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">int* arr = (int*)malloc(size * sizeof(int));</pre><br></div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un tableau dynamique est déclaré en C++ sous la forme:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">int* arr = new int[size];</pre></div>
</div><br>Un tableau statique est agrégé, ce qui signifie qu'il est alloué sur la pile et est donc libéré lorsque le flux sort de la fonction. D'un autre côté, un tableau dynamique est alloué sur un tas et y reste jusqu'à ce que la mémoire soit libérée manuellement.<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="operations-sur-les-tableaux-de-style-c">Opérations sur les tableaux de style C</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-de-style-c_limites-des-tableaux-de-style-c">Limites des tableaux de style C</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-de-style-c_limites-des-tableaux-de-style-c" href="#operations-sur-les-tableaux-de-style-c">Limites des tableaux de style C</a>
</h2><br>Bien que les tableaux de style C fassent l'affaire, ils ne sont pas couramment utilisés. Il existe un certain nombre de limites qui indiquent la nécessité de trouver de meilleures solutions. Certaines des principales limitations parmi celles-ci sont les suivantes:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">L'allocation et la désallocation de mémoire doivent être gérées manuellement. Un échec de désallocation peut provoquer une fuite de mémoire, c'est-à-dire lorsqu'une adresse mémoire devient inaccessible.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La fonction operator[ ] ne vérifie pas si l'argument est plus grand que la taille d'un tableau. Cela peut entraîner des erreurs de segmentation ou une corruption de la mémoire en cas d'utilisation incorrecte.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La syntaxe des tableaux imbriqués devient très compliquée et conduit à un code illisible.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La copie en profondeur n'est pas disponible en tant que fonction par défaut. Il doit être mis en oeuvre manuellement.</div>
</div><br>Pour éviter ces problèmes, C++ fournit un wrapper très fin sur un tableau de style C appelé (std::array).<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="operations-sur-les-tableaux-generiques--std--array-">Opérations sur les tableaux génériques (std::array)</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-dynamiques-predefinis_introduction">Introduction</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_utilisation-d-un-tableau-generique">Utilisation d'un tableau générique</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_gestion-des-exceptions-lors-de-l-acces-a-un-element">Gestion des exceptions lors de l'accès à un élément</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_passage-d-un-tableau-generique-en-argument-a-une-fonction">Passage d'un tableau générique en argument à une fonction</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_passage-en-argument-de-tableau-generique-de-n-importe-quelle-taille">Passage en argument de tableau générique de n'importe quelle taille</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_utilisation-des-iterateurs-sur-un-tableau-generique">Utilisation des itérateurs sur un tableau générique</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_parcours-d-un-tableau-generique-en-sens-inverse">Parcours d'un tableau générique en sens inverse</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#operations-sur-les-tableaux-generiques--std--array-_autres-fonctionnalites">Autres fonctionnalités</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques-predefinis_introduction" href="#operations-sur-les-tableaux-generiques--std--array-">Introduction</a>
</h2><br>Le tableau (std::array) automatise l'allocation et la désallocation de mémoire. C'est est une classe de modèle générique qui prend deux paramètres: le type des éléments et la taille du tableau.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_utilisation-d-un-tableau-generique" href="#operations-sur-les-tableaux-generiques--std--array-">Utilisation d'un tableau générique</a>
</h2><br>Dans l'exemple suivant, nous allons déclarer un tableau (std::array) de (int) de taille (10), définir la valeur de l'un des éléments, puis imprimer cette valeur pour nous assurer qu'elle fonctionne.<br><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 10&gt; arr; // array of int of size 10
    arr[0] = 1; // Sets the first element as 1

    std::cout &lt;&lt; "First element: " &lt;&lt; arr[0] &lt;&lt; std::endl;

    std::array&lt;int, 4&gt; arr2 = {1, 2, 3, 4};

    std::cout &lt;&lt; "Elements in second array: ";
    for(int i = 0; i &lt; arr2.size(); i++) {
        std::cout &lt;&lt; arr2[i] &lt;&lt; " ";
    }
    std::cout &lt;&lt; "\n";
}
//===============================================</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
First element: 1
Elements in second array: 1 2 3 4
//===============================================</pre><br>Comme nous pouvons le voir, le tableau (std::array) fournit l'opérateur[], qui est identique au tableau de style C, pour éviter le coût de vérification si l'index est inférieur à la taille du tableau.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_gestion-des-exceptions-lors-de-l-acces-a-un-element" href="#operations-sur-les-tableaux-generiques--std--array-">Gestion des exceptions lors de l'accès à un élément</a>
</h2><br>Le tableau (std::array)  fournit une fonction appelée at(index), qui lève une exception si l'argument n'est pas valide. De cette façon, nous pouvons gérer l'exception de manière appropriée. Ainsi, si nous avons un morceau de code dans lequel nous accéderons à un élément avec un peu d'incertitude, comme un index de tableau dépendant de l'entrée de l'utilisateur, nous pouvons toujours détecter l'erreur en utilisant la gestion des exceptions, comme le montre l'exemple suivant.<br><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 4&gt; arr = {1, 2, 3, 4};

    try
    {
        std::cout &lt;&lt; arr.at(4); // No error
        std::cout &lt;&lt; arr.at(5); // Throws exception std::out_of_range
    }
    catch (const std::out_of_range&amp; ex)
    {
        std::cerr &lt;&lt; ex.what();
    }
    std::cout &lt;&lt; "\n";
}
//===============================================
</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
array::at: __n (which is 4) &gt;= _Nm (which is 4)
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_passage-d-un-tableau-generique-en-argument-a-une-fonction" href="#operations-sur-les-tableaux-generiques--std--array-">Passage d'un tableau générique en argument à une fonction</a>
</h2><br>Passer le tableau (std::array) à une autre fonction est similaire à transmettre n'importe quel type de données intégré. Nous pouvons le passer par valeur ou par référence, avec ou sans const. De plus, la syntaxe n'implique aucune opération liée au pointeur ni aucune opération de référencement et de déréférencement. Par conséquent, la lisibilité est bien meilleure que celle des tableaux de style C, même pour les tableaux multidimensionnels. L'exemple suivant montre comment transmettre un tableau par valeur:<br><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 5&gt; arr = {1, 2, 3, 4, 5};
    print(arr);
}
//===============================================
void GArrayRun::print(const std::array&lt;int, 5&gt;&amp; arr)
{
    for(auto ele : arr)
    {
        std::cout &lt;&lt; ele &lt;&lt; ", ";
    }
    std::cout &lt;&lt; "\n";
}
//===============================================</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
1, 2, 3, 4, 5,
//===============================================</pre><br>Nous ne pouvons pas transmettre un tableau d'une autre taille pour cette fonction, car la taille du tableau fait partie du type de données du paramètre de fonction. Ainsi, par exemple, si nous passons (std::array&lt;int, 10&gt;), le compilateur renverra une erreur indiquant qu'il ne peut pas correspondre au paramètre de la fonction, ni convertir de l'un à l'autre.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_passage-en-argument-de-tableau-generique-de-n-importe-quelle-taille" href="#operations-sur-les-tableaux-generiques--std--array-">Passage en argument de tableau générique de n'importe quelle taille</a>
</h2><br>Si nous voulons avoir une fonction d'affichage qui prend en paramètre un tableau (std::array) de n'importe quelle taille, nous pouvons créer un modèle générique de taille du tableau pour la fonction d'affichage, et cela générera du code pour toutes les tailles requises du tableau.<br><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 4&gt; arr1 = {1, 2, 3, 4};
    std::array&lt;int, 5&gt; arr2 = {1, 2, 3, 4, 5};
    print(arr1);
    print(arr2);
}
//===============================================
template &lt;size_t N&gt;
void GArrayRun::print(const std::array&lt;int, N&gt;&amp; arr)
{
    for(auto ele : arr)
    {
        std::cout &lt;&lt; ele &lt;&lt; ", ";
    }
    std::cout &lt;&lt; "\n";
}
//===============================================</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
1, 2, 3, 4,
1, 2, 3, 4, 5,
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_utilisation-des-iterateurs-sur-un-tableau-generique" href="#operations-sur-les-tableaux-generiques--std--array-">Utilisation des itérateurs sur un tableau générique</a>
</h2><br>Toutes les fonctions pour lesquelles nous devons spécifier une position à l'intérieur du tableau générique sont basées sur des itérateurs; par exemple, l'insertion à une position spécifique, la suppression d'éléments dans une plage ou à une position spécifique et d'autres fonctions similaires. Cela rend le code plus réutilisable, maintenable et lisible.<br><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 5&gt; arr = {1, 2, 3, 4, 5};
    print(arr);
}
//===============================================
void GArrayRun::print(const std::array&lt;int, 5&gt;&amp; arr)
{
    for(auto it = arr.begin(); it != arr.end(); it++)
    {
        auto element = (*it);
        std::cout &lt;&lt; element &lt;&lt; ' ';
    }
    std::cout &lt;&lt; "\n";
}
//===============================================</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
1 2 3 4 5
//===============================================</pre><br>Il existe d'autres formes d'itérateurs, telles que const_iterator et reverse_iterator, qui sont également très utiles. const_iterator est une version const de l'itérateur normal. Si le tableau est déclaré comme étant un const, ses fonctions liées aux itérateurs, telles que begin() et end(), renvoient const_iterator.
reverse_iterator nous permet de parcourir le tableau dans le sens inverse. Ainsi, ses fonctions, telles que l'opérateur d'incrémentation (++) et advance, sont l'inverse de telles opérations pour les itérateurs normaux.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_parcours-d-un-tableau-generique-en-sens-inverse" href="#operations-sur-les-tableaux-generiques--std--array-">Parcours d'un tableau générique en sens inverse</a>
</h2><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 5&gt; arr = {1, 2, 3, 4, 5};
    print(arr);
}
//===============================================
void GArrayRun::print(const std::array&lt;int, 5&gt;&amp; arr)
{
    for(auto it = arr.rbegin(); it != arr.rend(); it++)
    {
        auto element = (*it);
        std::cout &lt;&lt; element &lt;&lt; ' ';
    }
    std::cout &lt;&lt; "\n";
}
//===============================================</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
5 4 3 2 1
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-generiques--std--array-_autres-fonctionnalites" href="#operations-sur-les-tableaux-generiques--std--array-">Autres fonctionnalités</a>
</h2><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Exemple:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GArrayRun::run() {
    std::array&lt;int, 5&gt; arr = {1, 2, 3, 4, 5};
    std::cout &lt;&lt; arr.front() &lt;&lt; std::endl; // Prints 1
    std::cout &lt;&lt; arr.back() &lt;&lt; std::endl; // Prints 5
    std::cout &lt;&lt; *(arr.data() + 1) &lt;&lt; std::endl; // Prints 2
}
//===============================================</pre><br>Résultat:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
1
5
2
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
