</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_introduction" href="#operations-sur-les-tableaux-dynamiques-customises">Introduction</a>
</h2><br>Nous écrirons une petite application pour gérer les dossiers des élèves dans une école. Le nombre d'élèves dans une classe et leurs coordonnées seront donnés en guise de paramètres. Nous écrirons un conteneur de type tableau pour gérer les données, qui peut également prendre en charge le dimensionnement dynamique. Nous implémenterons également certaines fonctions utilitaires pour fusionner différentes classes.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-la-structure-d-un-eleve" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de la structure d'un élève</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
struct GStudent
{
    std::string name;
    int standard;
};
//===============================================</pre><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La propriété (name) correspond au nom de l'élève (Par exemple, Jean).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La propriété (standard) correspond au niveau de l'élève (Par exemple, 6 pour la classe de 6ème).</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-la-structure-du-tableau-dynamique" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de la structure du tableau dynamique</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    T* data;
    size_t n;
};
//===============================================</pre><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La propriété (data) correspondant à une donnée est de type de générique dans le but de manipuler tout type de données.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La propriété (n) correspond au nombre de données à manipuler.</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-du-constructeur" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation du constructeur</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
GDynamicArray&lt;GStudent&gt; class1(3);
//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    GDynamicArray(int n)
    {
        this-&gt;n = n;
        data = new T[n];
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-du-constructeur-de-copie" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation du constructeur de copie</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
auto class2 = class1;
//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    GDynamicArray(const GDynamicArray&lt;T&gt; &amp;other)
    {
        n = other.n;
        data = new T[n];

        for (int i = 0; i &lt; n; i++)
            data[i] = other[i];
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-du-destructeur" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation du destructeur</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    ~GDynamicArray()
    {
        delete[] data;
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-l-operateur-d-acces" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de l'opérateur d'accès</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
class1[0] = GStudent{"Jean", 6};
class1[1] = GStudent{"Pierre", 5};
class1[2] = GStudent{"Paul", 4};
//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    //===============================================
    T &amp;operator[](int index)
    {
        return data[index];
    }
    //===============================================
    const T &amp;operator[](int index) const
    {
        return data[index];
    }
    //===============================================
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-la-fonction-d-acces-" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de la fonction d'accès&nbsp;</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
class1.at(0) = GStudent{"John", 8};
//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    T &amp;at(int index)
    {
        if (index &gt;= 0 &amp;&amp; index &lt; n)
            return data[index];
        throw "Index out of range";
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-la-fusion-de-classes" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de la fusion de classes</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
auto class3 = class1 + class2;
//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    friend GDynamicArray&lt;T&gt; operator+(const GDynamicArray&lt;T&gt; &amp;arr1, GDynamicArray&lt;T&gt; &amp;arr2)
    {
        GDynamicArray&lt;T&gt; result(arr1.size() + arr2.size());
        std::copy(arr1.begin(), arr1.end(), result.begin());
        std::copy(arr2.begin(), arr2.end(), result.begin() + arr1.size());

        return result;
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-des-iterateurs" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation des itérateurs</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    //===============================================
    const T *begin() const
    {
        return data;
    }
    //===============================================
    T *end()
    {
        return data + n;
    }
    //===============================================
    const T *end() const
    {
        return data + n;
    }
    //===============================================
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-la-recuperation-de-la-taille" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de la récupération de la taille</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    size_t size() const
    {
        return n;
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-l-operateur-d-affichage-d-un-tableau" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de l'opérateur d'affichage d'un tableau</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
std::cout &lt;&lt; class1.toString() &lt;&lt; std::endl;
//===============================================
template &lt;typename T&gt;
struct GDynamicArray
{
    std::string toString(const std::string &amp;sep = ", ")
    {
        if (n == 0)
            return "";
        std::ostringstream os;
        os &lt;&lt; data[0];

        for (int i = 1; i &lt; n; i++)
            os &lt;&lt; sep &lt;&lt; data[i];

        return os.str();
    }
};
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_implementation-de-l-operateur-d-affichage-d-un-eleve" href="#operations-sur-les-tableaux-dynamiques-customises">Implémentation de l'opérateur d'affichage d'un élève</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
std::ostream &amp;operator&lt;&lt;(std::ostream &amp;os, const GStudent &amp;s)
{
    return (os &lt;&lt; "[Name: " &lt;&lt; s.name &lt;&lt; ", Standard: " &lt;&lt; s.standard &lt;&lt; "]\n");
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="operations-sur-les-tableaux-dynamiques_exemple-d-utilisation-du-tableau" href="#operations-sur-les-tableaux-dynamiques-customises">Exemple d'utilisation du tableau</a>
</h2><br>Utilisation:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GDynamicArrayRun::run() {
    int nStudents = 3;
    GDynamicArray&lt;GStudent&gt; class1(nStudents);
    class1[0] = GStudent{"Jean", 6};
    class1[1] = GStudent{"Pierre", 5};
    class1[2] = GStudent{"Paul", 4};

    // Now, let's try to access the student
    // out of range in the array
    try
    {
        // No exception, undefined behavior
        // class1[nStudents] = GStudent{"John", 8};
        // std::cout &lt;&lt; "class1 student set out of range without exception" &lt;&lt; std::endl;

        // Will throw exception
        class1.at(nStudents) = GStudent{"John", 8};
    }
    catch (...)
    {
        std::cout &lt;&lt; "Exception caught" &lt;&lt; std::endl;
    }

    auto class2 = class1; // Deep copy

    std::cout &lt;&lt; "Second class after initialized using first array :\n" &lt;&lt; class2.toString() &lt;&lt; std::endl;

    auto class3 = class1 + class2;
    // Combines both classes and creates a bigger one

    std::cout &lt;&lt; "Combined class :\n";
    std::cout &lt;&lt; class3.toString() &lt;&lt; std::endl;
}
